import Update from './components/update'
import ListMethods from './components/listMethods';




export default class App extends Component {


  state = {
    customers: [],
    isUpdate: true,
    selectedUser: [],
    notFound: true,
    isDelete: null,
    selectedUser: [],
    url: "http://localhost:4444",
    paths: {
      update: "/update/",
      delete: "/delete/",
      getAllCustomers: "/logs"
    }
