  searchCustomers = (input) => {
    if (input.length > 0) {
      const { customers } = this.state
      const unHandledCustomers = [...customers];
      const sortedCustomers = unHandledCustomers.filter((a) => a.LanguageCode.toLowerCase().includes(input.toLowerCase()))
      if (sortedCustomers.length > 0) {
        this.setState({ customers: sortedCustomers })
        this.setState({ notFound: true })
      }
      else {
        this.setState({ notFound: false })
      }
    }
    else {
      this.getCustomers();
    }
  }

  removeCustomerFromDB = customer => {
    const { url, paths, customers } = this.state
    let newCustomers = [...customers]
    newCustomers = newCustomers.filter(e => e.Id !== customer.Id)
    this.setState({ customers: newCustomers })
    let fetchUrl = url + paths.delete + customer.Id
    fetch(fetchUrl).then(resp => resp.json()).then(resp => console.log(resp.deleted))
  }



  sortCustomersByResourceCode = (sortParameter) => {
    const { customers } = this.state;
    const sortedCustomers = [...customers]
    switch (sortParameter) {
      case 1: {
        sortedCustomers.sort((a, b) => a.Id - b.Id)
        this.setState({ customers: sortedCustomers })
        break
      }
      case 2: {
        sortedCustomers.sort((a, b) => {
          if (a.LanguageCode < b.LanguageCode) return -1;
          if (a.LanguageCode > b.LanguageCode) return 1;
          return 0;
        });
        this.setState({ customers: sortedCustomers })
        break



      }
      case 3: {
        sortedCustomers.sort((a, b) => {
          if (a.PageName < b.PageName) return -1;
          if (a.PageName > b.PageName) return 1;
          return 0;
        });
        this.setState({ customers: sortedCustomers })
        break
      }
      case 4: {
        sortedCustomers.sort((a, b) => a.ResourceCode - b.ResourceCode)
        this.setState({ customers: sortedCustomers })
        break
      }
      case 5: {
        sortedCustomers.sort((a, b) => {
          if (a.Resource < b.Resource) return -1;
          if (a.Resource > b.Resource) return 1;
          return 0;
        });
        this.setState({ customers: sortedCustomers })
        break
      }
      default: {
        break
      }
    }
  }
  getCustomers = async () => {
    const { url, paths } = this.state
    let fetchUrl = url + paths.getAllCustomers
    await fetch(fetchUrl).then(resp => resp.json()).then(resp => this.setState({ customers: resp }))
  }

  componentDidMount() {
    this.getCustomers()
  }
  setCurrentListMethod = element => {
    document.querySelectorAll(".listMethods").forEach(e => e.style.color = "#333")
    element.style.color = "rgb(29, 206, 41)"
  }
  setUpdateState = state => {

    this.setState({ isUpdate: state })
  }



  render() {
    const { customers, isUpdate, selectedUser } = this.state

    return (
      <div>
        {customers.length > 0 && (
          <div className='mainContainer_0'>






            <ListMethods
              setCurrentListMethod={this.setCurrentListMethod}
              sortCustomers={this.sortCustomersByResourceCode}
              searchCustomers={this.searchCustomers}
              notFound={this.state.notFound}
            ></ListMethods>



            <div className='updateMain'>
              <Update
                updateScreenState={this.setUpdateState}
                isUpdate={this.state.isUpdate}
                customer={selectedUser}
